  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sherburne
  National Wildlife Refuge summarizes Refuge activities during the 1996 calendar year.
  The report begins with a summary of the yearu2019s highlights and climatic conditions.
  Land acquisition is also covered. The report includes a planning section which discusses
  the management plan, research, and investigations. Refuge administration is outlined;
  information about personnel, manpower programs, volunteer programs, funding, and
  safety is given. Habitat management is also covered. Subjects include wetlands,
  grasslands, fire management, pest control, and private lands. The wildlife section
  of the report discusses endangered species, threatened species, waterfowl, marsh
  birds, waterbirds, game mammals, and animal control. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive exhibits, hunting,
  fishing, trapping, wildlife observation, and law enforcement. The equipment and
  facilities section of the report provides information about major maintenance, equipment
  utilization and replacement, communication systems, and computer systems. Cooperative
  programs and items of interest are provided at the end. Refuge brochures are attached.\",\n\t\"owner_org\":
